import { Link } from "react-router-dom"
import "./notFound.css";
const NotFound = () => {
  return (
    <div className="not-found">
      <h2>404..</h2><span> That's an error</span>
      <h4>The requested URL /badpage was not found on ths server. That's all we know</h4>
      <Link to="/">Back to the homepage...</Link>
    </div>
  );
}
 

export default NotFound;
